INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'pagina', 0, 4, 4, 'und', 0, '<p>No importa qué camino se le pasa, mientras exista ese camino.&nbsp;Internamente el módulo obtendrá y ejecutar la función de devolución de llamada que representa el contenido.&nbsp;A continuación, tomará ese contenido y mostrarlo dentro de un modal colorbox.</p>\r\n\r\n<h4>Galería Soporte</h4>\r\n\r\n<p><strong>ACTUALIZACIÓN:</strong>&nbsp;En la última versión DEV, tendrá que agregar la clase "colorbox-nodo-gallery" junto con el atributo rel para crear la galería de pantalla.</p>\r\n\r\n<p>Usted puede utilizar el atributo rel para crear galerías de contenido desde una única página.Simplemente agregue el atributo rel de este modo:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div><span style="line-height:1.2">Vistas Soporte</span></div>\r\n\r\n<p>Hay una integración desde puntos de vista que se extiende la opción "Enlace con este campo a la pieza original de contenido".&nbsp;Hay opciones para activar ese enlace en un enlace colorbox automáticamente y proporcionar la anchura y la altura tamb</p>\r\n', '', 'full_html'),
('node', 'pagina', 0, 16, 16, 'und', 0, '<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Ser el eje principal de encuentro de la ciudad de Medellín, con la mejor ubicación, seguridad y variedad de servicios, creando estrategias de mercadeo enfocadas&nbsp; a nuestros clientes internos y externos, para así satisfacer sus necesidades.</span></span></p>\r\n', '', 'full_html'),
('node', 'pagina', 0, 17, 17, 'und', 0, '<p class="rtejustify"><span style="font-size:12px">Para el año 2015, El Centro Comercial Terminal del Norte será la mejor alternativa de la ciudad para hacer compras, reconocido por su ubicación, facilidad de transporte y buenos precios.</span></p>\r\n', '', 'full_html'),
('node', 'pagina', 0, 18, 18, 'und', 0, '<p class="rtejustify"><strong><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">VALORES CORPORATIVOS:</span></span></strong></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif"><strong>Transparencia</strong>: actuamos de manera clara, consistente y oportuna.</span></span></p>\r\n\r\n<p class="rtejustify"><strong style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">Respeto por las personas</strong><span style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">: damos un trato digno a las personas y valoramos sus diferencias.</span></p>\r\n\r\n<p class="rtejustify"><strong style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">Actitud de servicio</strong><span style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">: somos amables, oportunos y eficaces en la prestación de nuestros servicios.</span></p>\r\n\r\n<p class="rtejustify"><strong style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">Trabajo en equipo</strong><span style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">: valoramos y fomentamos el aporte de las personas para el logro de los objetivos comunes.</span></p>\r\n\r\n<p class="rtejustify"><strong style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">Alto desempeño</strong><span style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">: superamos continuamente nuestras metas y optimizamos el uso de recursos, para crear valor.</span></p>\r\n\r\n<p class="rtejustify"><strong style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">Orientación al copropietario y cliente en general</strong><span style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">: construimos relaciones de largo plazo con los copropietarios y clientes.</span></p>\r\n\r\n<p class="rtejustify">&nbsp;</p>\r\n\r\n<p class="rtejustify"><strong><span style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">POLÍTICA DE SAULD OCUPACIONAL:</span></strong></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">El Centro Comercial Terminal del Norte se compromete a cumplir con todas las leyes, decretos, resoluciones y demás normas que sean expedidas para reglamentar el área de Salud Ocupacional con el propósito de implementarlas y ejecutarlas. También con el uso de los elementos de protección personal, como parte esencial de toda labor para evitar la ocurrencia de accidentes de trabajo o la materialización de un riesgo.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Dentro de los objetivos primordiales del Centro Comercial está el de la protección y mantenimiento del mayor nivel de bienestar, tanto físico como mental, de todos los trabajadores , disminuyendo al máximo la generación de accidentes de trabajo y los riesgos en su origen, así se logrará mantener un ambiente sano y adecuado para laborar.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Nuestro compromiso también está basado en facilitar los medios para la preservación de buenas condiciones para operación de los recursos materiales y económicos, logrando la optimización en su uso y minimizando cualquier tipo de pérdida.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Para las directivas del Centro Comercial es de gran prioridad garantizar a sus empleados las condiciones y el manejo de residuos para así tener un medio ambiente sano y seguro, po medio de equipos, procedimientos y programas adecuados , cumpliendo con las normas vigentes. Todos los trabajadores serán responsables de su seguridad, la del personal a su cargo y de la empresa.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">RUBÉN DARÍO CORREA MEJÍA</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Gerente Administrativo</span></span></p>\r\n', '', 'full_html'),
('node', 'pagina', 0, 19, 19, 'und', 0, '<p class="rtejustify"><strong><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">RESEÑA HISTÓRICA</span></span></strong></p>\r\n\r\n<p class="rtejustify"><strong><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">PRESENTACIÓN</span></span></strong></p>\r\n\r\n<p class="rtejustify"><span style="font-family:arial,helvetica,sans-serif; font-size:12px">La Terminal de Transportes Mariano Ospina Pérez dejó marcado un precedente en la historia de Medellín y de todo el país, pues desde sus inicios ha sido un polo de desarrollo de la ciudad y una catapulta al intercambio comercial y cultural, al permitir la entrada de cientos de pasajeros provenientes de varios municipios y la salida de otros tantos hacia tierra tal vez inhóspitas pero a la vez atrayentes.</span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">La construcción de la Terminal de Transportes en la capital antiqueña significó para todos los habitantes de la ciudad un cambio radical en las costumbres, pues no sólo descongestionó los antiguos&nbsp; sectores de Guayaquil y Abejorral, sino que le brindó a los pasajeros que llegaban&nbsp; y que salían la oportunidad de viajar de forma segura y cómo, a los empresarios del transporte los organizó de tal manera para que ofrecieran una presentación del servicio mucho más coordinada y competente, así como a la autoridades de tránsito les permitió obtener un mejor control sobre itinerarios, cupos, tarifas y demás asuntos concernientes&nbsp; las compañías transportadoras.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Es tal vez esta la razón por la que la que la Terminal es visitada por unas 30 mil personas diariamente, por representar un centro integrado de prestación de servicios varios para satisfacer hasta los gustos más exigentes.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Les presentamos la historia de la Terminal de Transportes Mariano Ospina Pérez de la ciudad de Medellín, un espacio abierto a la comunidad en general, emblema de la pujanza paisa que ha llevado al hombre a derribar sus fronteras para que el mundo esté un poco ,más cerca de sus pies.</span></span></p>\r\n\r\n<p class="rtejustify"><strong><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">TERMINAL DE BUSES Y TAXIS MARIANO OSPINA PÉREZ DE MEDELLÍN</span></span></strong></p>\r\n\r\n<p class="rtejustify"><strong><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">UNA HISTORIA DE IRES Y VENIRES</span></span></strong></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Hacia finales de los años 40 Medellín se perfilaba como una ciudad en pleno desarrollo de la que había que salir y a la que había que entrar con frecuencia.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Sin embargo, y a pesar de la gran necesidad no existía un centro especializado en transporte que pudiera movilizar a cientos de pasajeros de aquí para allá de manera ordenada y sistemática.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-family:arial,helvetica,sans-serif; font-size:12px; line-height:1.6">Por tal motivo los urbanistas Wiener – Sert trabajaron entre 1949 y 1951 en un plan piloto para Medellín, en el que diseñaron unas instalaciones adecuadas que sirvieran como núcleos de movimiento y concentración de las rutas de transporte, para rescatar la zona de los antiguos sectores de Guayaquil y Abejorral en donde funcionaba anteriormente todo el flujo de llegada y de salida de pasajeros intermunicipales pero de una forma desordenada, insegura y caótica.</span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Pero a pesar de los planes no fue sino hasta 1970 que comenzó a construirse el primer gran centro de transportes para la capital antioqueña, a la que hubo que darle consistencia con el decreto 2269 del 8 de noviembre de 1973 denominado “Plan Maestro”, el cual institucionalizo la modalidad de Terminal de Transportes en todo el país.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Se constituyó así la Sociedad Terminales de Transportes de Medellín S.A bajo el mandato de la alcaldesa de aquel entonces Sofía Medina de López, mediante escritura pública número 1693 de julio 13 de 1977 elaborada en la notaría décima de la ciudad, con el objeto de contribuir a la solución del problema del transporte mediante la construcción , organización, administración y explotación de una terminal para pasajeros de buses, ferrocarriles y demás medios masivos de transportes para el municipio de Medellín.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Las primeras personas encargadas de darle vida a la nueva terminal de transportes dentro de la recién fundada institución, fueron el doctor James Yepes Londoño, ingeniero nombrado como primer gerente de la Sociedad; el ingeniero Fabio Botero Gómez designado como director del proyecto y el doctor Roberto Trujillo quien realizó el plano arquitectónico&nbsp; definitivo con intervención posterior del doctor Álvaro Alarcón. El diseño de la terminal estuvo a cargo de los arquitectos Juan Guillermo Gómez y de Patricia Ángel y las firma constructoras ConConcreto S.A y Coninsa Ltda, fueron las encargadas de las obras de urbanismo y construcción.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Instituciones tales como el Municipio de Medellín, el departamento de Antioquia, Empresas Varias de Medellín, Ferrocarriles Nacionales de Colombia, Empresas Departamentales de Antioquia, , la Corporación Financiera del Transporte y posteriormente el Instituto Nacional del Transporte, se constituyeron en las primeras accionistas de esa nueva empresa que comenzó a edificarse en un lote de 20 hectáreas, con 35mil metros cuadrados de área construida, aledaño al centro de la ciudad y circundado por las comunas Nororiental y Noroccidental.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Concluido el proceso de construcción de la Terminal de Transportes de Medellín en diciembre de 1983, el alcalde de entonces expidió la resolución número 648, fijando los recorridos para los vehículos de servicio público regionales e interdepartamentales que debían utilizar las nuevas instalaciones de la Terminal.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Bajo decreto 3157 el Gobierno Nacional reglamentó el funcionamiento de este tipo de empresas, adjudicándolas bajo supervisión del Instituto Nacional de Transporte adscrito al Ministerio de Obras Públicas. Como la naciente Terminal de Buses y Taxis intermunicipales de Medellín&nbsp; Mariano Ospina Pérez cumplía con los parámetros contenidos en tal decreto, inició operaciones en firme el 16 de febrero de 1984, junto con 66 empresas trasportadoras y 105 establecimientos comerciales, convirtiéndose en la tercera construcción del mundo con la estructura metálica espacial de mayor magnitud.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Hoy en día la Terminal de transporte del norte se encuentra constituida como un centro comercial, en el cual se pueden encontrar productos y servicios tales como restaurantes, almacenes de ropa, calzado, salas de belleza, corporaciones y entidades bancarias, parqueaderos, teléfonos y baños&nbsp; públicos, salas de espera, espacios en los que pueden recrearse los niños, entre muchos otros tipos de locales.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">La Terminal de Transporte Mariano Ospina Pérez de la ciudad de Medellín se compone de un edificio principal que es el acopio de los taxis y buses, una estación férrea que está conectada con la estación Caribe del Metro, el edificio de encomiendas y la estación de servicios.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">La edificación está construida de forma abierta vertical y se compone de cuatro niveles que permiten un sistema de circulaciones siempre en sentido descendiente, resumiendo toda su estructura en un gran hall central.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">La Terminal de Buses y Taxis “Mariano Ospina Pérez” es hoy por hoy un centro vital para el país y Latinoamérica, pues en ella convergen dos actividades tradicionales para la economía antioqueña: el comercio y el transporte.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Protagonista de la dinamización e integración de las comunas con el resto de la ciudad, la terminal del norte ha sido también un espacio de interacción de las diferentes clases sociales y culturales que enriquecen al país, lo que será siempre punto de referencia e imaginario colectivo en la memoria de cientos de ciudadanos que comenzaron a contar sus historias una vez abrieron camino lejos de casa.</span></span></p>\r\n', '', 'full_html'),
('node', 'pagina', 0, 20, 20, 'und', 0, '<p><iframe frameborder="0" height="450" src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3320.3943957919464!2d-75.5717267301642!3d6.279083421245782!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8e4428d9cece5cf7%3A0xfc07b07c1455fe80!2sTerminal+Del+Norte!5e1!3m2!1ses-419!2ses!4v1401269306363" style="border:0" width="600"></iframe></p>\r\n\r\n<p class="rtejustify">Centro Comercial Terminal del Norte</p>\r\n\r\n<p class="rtejustify">Carrera 64 c #78-580</p>\r\n\r\n<p class="rtejustify">Medellín – Colombia</p>\r\n\r\n<p class="rtejustify">Como llegar a la terminal:</p>\r\n\r\n<p class="rtejustify">contamos con una excelente&nbsp; ubicación estratégica al norte de la ciudad con diferentes alternativas para llegar a nuestras instalaciones.&nbsp;Estación caribe del Metro</p>\r\n\r\n<p class="rtejustify">Rutas de buses:</p>\r\n\r\n<p class="rtejustify">Trinidad 313</p>\r\n\r\n<p class="rtejustify">Terminal 313</p>\r\n\r\n<p class="rtejustify">Terminal Parque Berrio 286 y 287</p>\r\n\r\n<p class="rtejustify">Ruta de la salud 313</p>\r\n\r\n<p class="rtejustify">Rutas hacia el municipio de Bello (autopista norte)</p>\r\n\r\n<p class="rtejustify">Transportes Medellín 306 a y 306 b</p>\r\n', '', 'php_code'),
('node', 'pagina', 0, 21, 21, 'und', 0, '<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">CONVENIOS COMERCIALES</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">La administración de la copropiedad dentro de sus estrategias de sostenibilidad y rentabilidad del edificio realiza la labor comercial de explotación económica de las zonas comunes, para las diferentes empresas que quieran hacer presencia de marca por medio de la publicidad fija y actividades BTL.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Stand comercial: muestra comercial, captura de base de datos y nuevos clientes, exhibición de productos. (Solo para empresas que no representen competencia directa para los locales comerciales que hacen parte del centro comercial)</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Volanteo: entrega de volantes por día en las diferentes zonas comunes del edificio</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Publicidad fija: cajas de luz, pendones, adhesivos, rompe tráficos, etc.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Activaciones de marca: flashmob, chirimía, personajes, degustaciones, música y eventos realizados por los clientes dentro de las instalaciones.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Vinculación eventos propios: mediante patrocinios y canjes.</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Canjes: intercambio de productos por espacios publicitarios.</span></span></p>\r\n\r\n<p class="rtejustify">&nbsp;</p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Para cotizaciones o ampliar información</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Andrea Pérez Bohdert</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">Directora Comercial</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">2309595 ext. 104</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">3176689479</span></span></p>\r\n\r\n<p class="rtejustify"><span style="font-size:12px"><span style="font-family:arial,helvetica,sans-serif">comercial@ccterminaldelnorte.com.co</span></span></p>\r\n', '', 'full_html'),
