(18, 'node', ' valores y políticas valores corporativos  transparencia  actuamos de manera clara consistente y oportuna respeto por las personas  damos un trato digno a las personas y valoramos sus diferencias actitud de servicio  somos amables oportunos y eficaces en la prestación de nuestros servicios trabajo en equipo  valoramos y fomentamos el aporte de las personas para el logro de los objetivos comunes alto desempeño  superamos continuamente nuestras metas y optimizamos el uso de recursos para crear valor orientación al copropietario y cliente en general  construimos relaciones de largo plazo con los copropietarios y clientes  política de sauld ocupacional  el centro comercial terminal del norte se compromete a cumplir con todas las leyes decretos resoluciones y demás normas que sean expedidas para reglamentar el área de salud ocupacional con el propósito de implementarlas y ejecutarlas también con el uso de los elementos de protección personal como parte esencial de toda labor para evitar la ocurrencia de accidentes de trabajo o la materialización de un riesgo dentro de los objetivos primordiales del centro comercial está el de la protección y mantenimiento del mayor nivel de bienestar tanto físico como mental de todos los trabajadores disminuyendo al máximo la generación de accidentes de trabajo y los riesgos en su origen así se logrará mantener un ambiente sano y adecuado para laborar nuestro compromiso también está basado en facilitar los medios para la preservación de buenas condiciones para operación de los recursos materiales y económicos logrando la optimización en su uso y minimizando cualquier tipo de pérdida para las directivas del centro comercial es de gran prioridad garantizar a sus empleados las condiciones y el manejo de residuos para así tener un medio ambiente sano y seguro po medio de equipos procedimientos y programas adecuados cumpliendo con las normas vigentes todos los trabajadores serán responsables de su seguridad la del personal a su cargo y de la empresa rubén darío correa mejía gerente administrativo  ', 0),
(19, 'node', ' reseña reseña histórica presentación la terminal de transportes mariano ospina pérez dejó marcado un precedente en la historia de medellín y de todo el país pues desde sus inicios ha sido un polo de desarrollo de la ciudad y una catapulta al intercambio comercial y cultural al permitir la entrada de cientos de pasajeros provenientes de varios municipios y la salida de otros tantos hacia tierra tal vez inhóspitas pero a la vez atrayentes la construcción de la terminal de transportes en la capital antiqueña significó para todos los habitantes de la ciudad un cambio radical en las costumbres pues no sólo descongestionó los antiguos sectores de guayaquil y abejorral sino que le brindó a los pasajeros que llegaban y que salían la oportunidad de viajar de forma segura y cómo a los empresarios del transporte los organizó de tal manera para que ofrecieran una presentación del servicio mucho más coordinada y competente así como a la autoridades de tránsito les permitió obtener un mejor control sobre itinerarios cupos tarifas y demás asuntos concernientes las compañías transportadoras es tal vez esta la razón por la que la que la terminal es visitada por unas 30 mil personas diariamente por representar un centro integrado de prestación de servicios varios para satisfacer hasta los gustos más exigentes les presentamos la historia de la terminal de transportes mariano ospina pérez de la ciudad de medellín un espacio abierto a la comunidad en general emblema de la pujanza paisa que ha llevado al hombre a derribar sus fronteras para que el mundo esté un poco más cerca de sus pies terminal de buses y taxis mariano ospina pérez de medellín una historia de ires y venires hacia finales de los años 40 medellín se perfilaba como una ciudad en pleno desarrollo de la que había que salir y a la que había que entrar con frecuencia sin embargo y a pesar de la gran necesidad no existía un centro especializado en transporte que pudiera movilizar a cientos de pasajeros de aquí para allá de manera ordenada y sistemática por tal motivo los urbanistas wiener sert trabajaron entre 1949 y 1951 en un plan piloto para medellín en el que diseñaron unas instalaciones adecuadas que sirvieran como núcleos de movimiento y concentración de las rutas de transporte para rescatar la zona de los antiguos sectores de guayaquil y abejorral en donde funcionaba anteriormente todo el flujo de llegada y de salida de pasajeros intermunicipales pero de una forma desordenada insegura y caótica pero a pesar de los planes no fue sino hasta 1970 que comenzó a construirse el primer gran centro de transportes para la capital antioqueña a la que hubo que darle consistencia con el decreto 2269 del 8 de noviembre de 1973 denominado plan maestro el cual institucionalizo la modalidad de terminal de transportes en todo el país se constituyó así la sociedad terminales de transportes de medellín sa bajo el mandato de la alcaldesa de aquel entonces sofía medina de lópez mediante escritura pública número 1693 de julio 13 de 1977 elaborada en la notaría décima de la ciudad con el objeto de contribuir a la solución del problema del transporte mediante la construcción organización administración y explotación de una terminal para pasajeros de buses ferrocarriles y demás medios masivos de transportes para el municipio de medellín las primeras personas encargadas de darle vida a la nueva terminal de transportes dentro de la recién fundada institución fueron el doctor james yepes londoño ingeniero nombrado como primer gerente de la sociedad el ingeniero fabio botero gómez designado como director del proyecto y el doctor roberto trujillo quien realizó el plano arquitectónico definitivo con intervención posterior del doctor álvaro alarcón el diseño de la terminal estuvo a cargo de los arquitectos juan guillermo gómez y de patricia ángel y las firma constructoras conconcreto sa y coninsa ltda fueron las encargadas de las obras de urbanismo y construcción instituciones tales como el municipio de medellín el departamento de antioquia empresas varias de medellín ferrocarriles nacionales de colombia empresas departamentales de antioquia la corporación financiera del transporte y posteriormente el instituto nacional del transporte se constituyeron en las primeras accionistas de esa nueva empresa que comenzó a edificarse en un lote de 20 hectáreas con 35mil metros cuadrados de área construida aledaño al centro de la ciudad y circundado por las comunas nororiental y noroccidental concluido el proceso de construcción de la terminal de transportes de medellín en diciembre de 1983 el alcalde de entonces expidió la resolución número 648 fijando los recorridos para los vehículos de servicio público regionales e interdepartamentales que debían utilizar las nuevas instalaciones de la terminal bajo decreto 3157 el gobierno nacional reglamentó el funcionamiento de este tipo de empresas adjudicándolas bajo supervisión del instituto nacional de transporte adscrito al ministerio de obras públicas como la naciente terminal de buses y taxis intermunicipales de medellín mariano ospina pérez cumplía con los parámetros contenidos en tal decreto inició operaciones en firme el 16 de febrero de 1984 junto con 66 empresas trasportadoras y 105 establecimientos comerciales convirtiéndose en la tercera construcción del mundo con la estructura metálica espacial de mayor magnitud hoy en día la terminal de transporte del norte se encuentra constituida como un centro comercial en el cual se pueden encontrar productos y servicios tales como restaurantes almacenes de ropa calzado salas de belleza corporaciones y entidades bancarias parqueaderos teléfonos y baños públicos salas de espera espacios en los que pueden recrearse los niños entre muchos otros tipos de locales la terminal de transporte mariano ospina pérez de la ciudad de medellín se compone de un edificio principal que es el acopio de los taxis y buses una estación férrea que está conectada con la estación caribe del metro el edificio de encomiendas y la estación de servicios la edificación está construida de forma abierta vertical y se compone de cuatro niveles que permiten un sistema de circulaciones siempre en sentido descendiente resumiendo toda su estructura en un gran hall central la terminal de buses y taxis mariano ospina pérez es hoy por hoy un centro vital para el país y latinoamérica pues en ella convergen dos actividades tradicionales para la economía antioqueña el comercio y el transporte protagonista de la dinamización e integración de las comunas con el resto de la ciudad la terminal del norte ha sido también un espacio de interacción de las diferentes clases sociales y culturales que enriquecen al país lo que será siempre punto de referencia e imaginario colectivo en la memoria de cientos de ciudadanos que comenzaron a contar sus historias una vez abrieron camino lejos de casa  ', 0),
